import React from "react";
import styled from "styled-components";
const Home = () => {
  return (
    <Wrapper>
      <StyledLeaderBoard>
        <h2>Leader board</h2>
      </StyledLeaderBoard>
    </Wrapper>
  );
};

const Wrapper = styled.div`
  font-size: 2rem;
`;

const StyledLeaderBoard = styled.div`
  font-style: 1.8rem;
`;
export default Home;
